import styled from "styled-components";
import Image from "../images/pikachu.jpg";
export const StyledHero = styled.div`
  background-image: url(${Image});
  height: 70vh;
  background-size: 100% 100%;
  background-repeat: no-repeat;
  position: relative;
`;
